import * as React from 'react';
import PropTypes from 'prop-types';

function CiscoSans() {
  return (
    <article>
      <h3>cisco-sans</h3>
      <code>
        {`import 'coi-common-ui/core/cisco-sans.css';`}
      </code>
    </article>
  );
}

export default CiscoSans;
